INSERT INTO `SERVMASK_PREFIX_aioseo_cache` VALUES (78,'addons','a:5:{i:0;O:8:\"stdClass\":18:{s:3:\"sku\";s:16:\"aioseo-image-seo\";s:4:\"name\";s:9:\"Image SEO\";s:7:\"version\";s:5:\"1.0.0\";s:5:\"image\";N;s:4:\"icon\";s:13:\"svg-image-seo\";s:6:\"levels\";a:5:{i:0;s:8:\"business\";i:1;s:6:\"agency\";i:2;s:4:\"plus\";i:3;s:3:\"pro\";i:4;s:5:\"elite\";}s:13:\"currentLevels\";a:3:{i:0;s:4:\"plus\";i:1;s:3:\"pro\";i:2;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:0;s:11:\"description\";s:147:\"<p>Globally control the Title attribute and Alt text for images in your content. These attributes are essential for both accessibility and SEO.</p>\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:28:\"https://aioseo.com/image-seo\";s:12:\"learnMoreUrl\";s:28:\"https://aioseo.com/image-seo\";s:9:\"manageUrl\";s:44:\"https://route#aioseo-search-appearance:media\";s:8:\"basename\";s:37:\"aioseo-image-seo/aioseo-image-seo.php\";s:9:\"installed\";b:0;s:8:\"isActive\";b:0;s:10:\"canInstall\";b:0;}i:1;O:8:\"stdClass\":18:{s:3:\"sku\";s:20:\"aioseo-video-sitemap\";s:4:\"name\";s:13:\"Video Sitemap\";s:7:\"version\";s:5:\"1.0.0\";s:5:\"image\";N;s:4:\"icon\";s:16:\"svg-sitemaps-pro\";s:6:\"levels\";a:5:{i:0;s:10:\"individual\";i:1;s:8:\"business\";i:2;s:6:\"agency\";i:3;s:3:\"pro\";i:4;s:5:\"elite\";}s:13:\"currentLevels\";a:2:{i:0;s:3:\"pro\";i:1;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:0;s:11:\"description\";s:242:\"<p>The Video Sitemap works in much the same way as the XML Sitemap module, it generates an XML Sitemap specifically for video content on your site. Search engines use this information to display rich snippet information in search results.</p>\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:32:\"https://aioseo.com/video-sitemap\";s:12:\"learnMoreUrl\";s:32:\"https://aioseo.com/video-sitemap\";s:9:\"manageUrl\";s:43:\"https://route#aioseo-sitemaps:video-sitemap\";s:8:\"basename\";s:45:\"aioseo-video-sitemap/aioseo-video-sitemap.php\";s:9:\"installed\";b:0;s:8:\"isActive\";b:0;s:10:\"canInstall\";b:0;}i:2;O:8:\"stdClass\":18:{s:3:\"sku\";s:21:\"aioseo-local-business\";s:4:\"name\";s:18:\"Local Business SEO\";s:7:\"version\";s:5:\"1.0.0\";s:5:\"image\";N;s:4:\"icon\";s:18:\"svg-local-business\";s:6:\"levels\";a:5:{i:0;s:8:\"business\";i:1;s:6:\"agency\";i:2;s:4:\"plus\";i:3;s:3:\"pro\";i:4;s:5:\"elite\";}s:13:\"currentLevels\";a:3:{i:0;s:4:\"plus\";i:1;s:3:\"pro\";i:2;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:0;s:11:\"description\";s:252:\"<p>Local Business schema markup enables you to tell Google about your business, including your business name, address and phone number, opening hours and price range. This information may be displayed as a Knowledge Graph card or business carousel.</p>\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:33:\"https://aioseo.com/local-business\";s:12:\"learnMoreUrl\";s:33:\"https://aioseo.com/local-business\";s:9:\"manageUrl\";s:40:\"https://route#aioseo-local-seo:locations\";s:8:\"basename\";s:47:\"aioseo-local-business/aioseo-local-business.php\";s:9:\"installed\";b:0;s:8:\"isActive\";b:0;s:10:\"canInstall\";b:0;}i:3;O:8:\"stdClass\":18:{s:3:\"sku\";s:19:\"aioseo-news-sitemap\";s:4:\"name\";s:12:\"News Sitemap\";s:7:\"version\";s:5:\"1.0.0\";s:5:\"image\";N;s:4:\"icon\";s:16:\"svg-sitemaps-pro\";s:6:\"levels\";a:4:{i:0;s:8:\"business\";i:1;s:6:\"agency\";i:2;s:3:\"pro\";i:3;s:5:\"elite\";}s:13:\"currentLevels\";a:2:{i:0;s:3:\"pro\";i:1;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:0;s:11:\"description\";s:283:\"<p>Our Google News Sitemap lets you control which content you submit to Google News and only contains articles that were published in the last 48 hours. In order to submit a News Sitemap to Google, you must have added your site to Google’s Publisher Center and had it approved.</p>\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:31:\"https://aioseo.com/news-sitemap\";s:12:\"learnMoreUrl\";s:31:\"https://aioseo.com/news-sitemap\";s:9:\"manageUrl\";s:42:\"https://route#aioseo-sitemaps:news-sitemap\";s:8:\"basename\";s:43:\"aioseo-news-sitemap/aioseo-news-sitemap.php\";s:9:\"installed\";b:0;s:8:\"isActive\";b:0;s:10:\"canInstall\";b:0;}i:4;O:8:\"stdClass\":18:{s:3:\"sku\";s:16:\"aioseo-redirects\";s:4:\"name\";s:19:\"Redirection Manager\";s:7:\"version\";s:5:\"1.0.0\";s:5:\"image\";N;s:4:\"icon\";s:12:\"svg-redirect\";s:6:\"levels\";a:5:{i:0;s:6:\"agency\";i:1;s:5:\"basic\";i:2;s:4:\"plus\";i:3;s:3:\"pro\";i:4;s:5:\"elite\";}s:13:\"currentLevels\";a:4:{i:0;s:5:\"basic\";i:1;s:4:\"plus\";i:2;s:3:\"pro\";i:3;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:0;s:11:\"description\";s:274:\"<p>Our Redirection Manager allows you to easily create and manage redirects for your broken links to avoid confusing search engines and users, as well as losing valuable backlinks. It even automatically sends users and search engines from your old URLs to your new ones.</p>\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:38:\"https://aioseo.com/redirection-manager\";s:12:\"learnMoreUrl\";s:38:\"https://aioseo.com/redirection-manager\";s:9:\"manageUrl\";s:30:\"https://route#aioseo-redirects\";s:8:\"basename\";s:37:\"aioseo-redirects/aioseo-redirects.php\";s:9:\"installed\";b:0;s:8:\"isActive\";b:0;s:10:\"canInstall\";b:0;}}','2022-01-08 19:04:10','2022-01-07 07:16:37','2022-01-07 19:04:10');
